import {combineReducers} from "redux";
import {authReducer} from "./auth";
import {layoutReducer} from "./layout";
import {compositionsReducer} from "./compositions";
import {showcaseReducer} from "./showcase";
import {homeReducer} from "./home";
import {suggestFormReducer} from "./suggestForm";
import {orderFormReducer} from "./orderForm";

export const rootReducer = combineReducers({
    layoutReducer,
    authReducer,
    compositionsReducer,
    showcaseReducer,
    homeReducer,
    suggestFormReducer,
    orderFormReducer,
})
